import { allLogoIcons, lookupLogoIcon } from '../handler'

describe('handler', () => {
  describe('allLogoIcons', () => {
    it('returns all logo icon file names in the logo icons directory without the filename extension', async () => {
      expect(await allLogoIcons()).toMatchSnapshot()
    })
  })

  describe('lookupLogoIcon', () => {
    it('returns correct logo icon when it can be found using the exact logo icon name', async () => {
      const logoIconToLookup = 'american express'
      const base64AmericanExpressLogo =
        ''

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
          },
        })
      ).toEqual({
        body: base64AmericanExpressLogo,
        headers: {
          'Access-Control-Allow-Origin': '*',
          'Cache-Control': 'max-age=600',
          'Content-Type': 'image/png',
        },
        isBase64Encoded: true,
        statusCode: 200,
      })
    })

    it('returns correct logo icon when it can be found using a partial match with unrelated characters appended', async () => {
      const logoIconToLookup = 'american express europe ltd'
      const base64AmericanExpressLogo =
        ''

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
          },
        })
      ).toEqual({
        body: base64AmericanExpressLogo,
        headers: {
          'Access-Control-Allow-Origin': '*',
          'Cache-Control': 'max-age=600',
          'Content-Type': 'image/png',
        },
        isBase64Encoded: true,
        statusCode: 200,
      })
    })

    it('returns correct logo icon when it can be found using a partial match with unrelated characters prepended', async () => {
      const logoIconToLookup = 'ltd world american express'
      const base64AmericanExpressLogo =
        ''

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
          },
        })
      ).toEqual({
        body: base64AmericanExpressLogo,
        headers: {
          'Access-Control-Allow-Origin': '*',
          'Cache-Control': 'max-age=600',
          'Content-Type': 'image/png',
        },
        isBase64Encoded: true,
        statusCode: 200,
      })
    })

    it('returns correct logo icon when it can be found by removing the whitespace', async () => {
      const logoIconToLookup = 'totally money cr ti di search'
      const base64TotallyMoneyLogo =
        ''

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
          },
        })
      ).toEqual({
        body: base64TotallyMoneyLogo,
        headers: {
          'Access-Control-Allow-Origin': '*',
          'Cache-Control': 'max-age=600',
          'Content-Type': 'image/png',
        },
        isBase64Encoded: true,
        statusCode: 200,
      })
    })

    it('returns 404 when logo icon cannot be found', async () => {
      const logoIconToLookup = 'Logo icon not to be found'

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
          },
        })
      ).toEqual({
        statusCode: 404,
        body: 'No logo icon found.',
      })
    })

    it('returns 400 when logoIconName query parameter is not present', async () => {
      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: null,
        })
      ).toEqual({
        body: 'Missing required request parameter: logoIconName.',
        statusCode: 400,
      })
    })

    it('returns logo icon resized when it can be found and size query parameter is provided', async () => {
      const logoIconToLookup = 'american express'
      const resizedBase64AmericanExpressLogo =
        ''

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
            size: '100',
          },
        })
      ).toEqual({
        body: resizedBase64AmericanExpressLogo,
        headers: {
          'Access-Control-Allow-Origin': '*',
          'Cache-Control': 'max-age=600',
          'Content-Type': 'image/png',
        },
        isBase64Encoded: true,
        statusCode: 200,
      })
    })

    it('returns 400 when logo icon can be found but size query parameter is over 200', async () => {
      const logoIconToLookup = 'american express'

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
            size: '400',
          },
        })
      ).toEqual({
        body: 'Request parameter size must be between 1 and 200.',
        statusCode: 400,
      })
    })

    it('returns 400 when logo icon can be found but size query parameter is less than 1', async () => {
      const logoIconToLookup = 'american express'

      expect(
        // @ts-expect-error I don't care about the type of the event parameter.
        await lookupLogoIcon({
          queryStringParameters: {
            logoIconName: logoIconToLookup,
            size: '-2',
          },
        })
      ).toEqual({
        body: 'Request parameter size must be between 1 and 200.',
        statusCode: 400,
      })
    })
  })
})
